$(document).ready(function(){$("select").change(function(){var c="#"+$(this).attr("id");var b=$(c+" option:selected").text();var d=c.split("_");var a=d[1];$.post("/Admin/ChangeRole",{id:a,role:b})});$(window).scroll(function(){if($(window).scrollTop()==$(document).height()-$(window).height()){var b=document.URL.split("//");b=(b[1]?b[1]:b[0]).split("/");var a=$("#users tr:last").attr("id");$.ajax({url:"http://"+b[0]+"/Admin/GetNextUsers",data:{last_id:a},success:function(c){var e="";for(var d=0;d<c.length;d++){e+="<tr id='"+c[d].Id+"'><td>"+c[d].Name+"</td><td>"+c[d].FirstName+"</td><td>"+c[d].Login+"</td><td>"+c[d].Mail+"</td><td>"+c[d].City+"</td><td><select><option>"+c[d].Role+"</option><option>Moderateur</option><option>Administrateur</option></select></td><td><a href='http://"+b[0]+"/Admin/BlockUser/"+c[d].Id+"'>Supprimer</a></td></tr>"}$("#users").append(e)},dataType:"json"})}})});